import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  IconButton,
} from '@mui/material';
import {
  CameraAlt,
  LocalShipping,
  MenuBook,
  Science,
  Toys,
  HomeWork,
} from '@mui/icons-material';

const categories = [
  {
    id: 1,
    name: 'Telescopes & Accessories',
    description: 'Premium telescopes and accessories for all skill levels, from beginners to professionals. Starting from ₹3,999.',
    icon: <CameraAlt sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1579532537598-459ecdaf39cc?auto=format&fit=crop&w=1024&q=80',
    path: '/telescopes',
    color: 'primary.main',
    products: [
      {
        id: 1,
        name: 'Matrix Phoenix Refractor Telescope',
        price: 3999,
        description: 'Perfect for beginners with 60/700 refractor and aluminum tripod',
        image: 'telescope1.jpg'
      },
      {
        id: 2,
        name: 'Celestron AstroMaster Motor Drive',
        price: 32999,
        description: 'Professional telescope with motor drive and automatic tracking',
        image: 'telescope2.jpg'
      }
    ]
  },
  {
    id: 2,
    name: 'Space Merchandise',
    description: 'Show your love for space with NASA apparel and collectibles. Affordable space-themed products from ₹999.',
    icon: <LocalShipping sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1517976487492-5750f3195933?auto=format&fit=crop&w=1024&q=80',
    path: '/merchandise',
    color: 'cosmic.nebula',
    products: [
      {
        id: 3,
        name: 'NASA Apollo Mission Poster Set',
        price: 1499,
        description: 'Vintage-style NASA mission posters',
        image: 'poster1.jpg'
      },
      {
        id: 4,
        name: 'Astronaut Hoodie',
        price: 1999,
        description: 'Premium quality space-themed hoodie',
        image: 'hoodie1.jpg'
      }
    ]
  },
  {
    id: 3,
    name: 'Books & Education',
    description: 'Comprehensive astronomy guides and star charts for students and learners. Starting at just ₹799.',
    icon: <MenuBook sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1614935151651-0bea6508db6b?auto=format&fit=crop&w=1024&q=80',
    path: '/books',
    color: 'cosmic.star',
    products: [
      {
        id: 5,
        name: 'Astronomy Guide 2024',
        price: 799,
        description: 'Complete guide to astronomy for beginners',
        image: 'book1.jpg'
      },
      {
        id: 6,
        name: 'Star Atlas Premium',
        price: 1499,
        description: 'Detailed star charts and celestial maps',
        image: 'atlas1.jpg'
      }
    ]
  },
  {
    id: 4,
    name: 'Collectibles',
    description: 'Own authentic meteorite fragments and space shuttle models. Premium collectibles from ₹2,999.',
    icon: <Science sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1534293230397-c067fc201ab8?auto=format&fit=crop&w=1024&q=80',
    path: '/collectibles',
    color: 'cosmic.galaxy',
    products: [
      {
        id: 7,
        name: 'Authentic Meteorite Fragment',
        price: 4999,
        description: 'Certified meteorite fragment with display case',
        image: 'meteorite1.jpg'
      },
      {
        id: 8,
        name: 'Space Shuttle Model',
        price: 2999,
        description: 'Detailed scale model of NASA space shuttle',
        image: 'model1.jpg'
      }
    ]
  },
  {
    id: 5,
    name: 'Gadgets & Kits',
    description: 'Smart telescopes and DIY rover kits for tech enthusiasts and hobbyists. Starting from ₹3,499.',
    icon: <Toys sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1446776653964-20c1d3a81b06?auto=format&fit=crop&w=1024&q=80',
    path: '/gadgets',
    color: 'cosmic.meteor',
    products: [
      {
        id: 9,
        name: 'DIY Mars Rover Kit',
        price: 3499,
        description: 'Build your own Mars rover with this educational kit',
        image: 'rover1.jpg'
      },
      {
        id: 10,
        name: 'Smart Star Finder',
        price: 24999,
        description: 'Digital star finder with smartphone integration',
        image: 'finder1.jpg'
      }
    ]
  },
  {
    id: 6,
    name: 'Home & Lifestyle',
    description: 'Transform your space with galaxy projectors and cosmic-themed decor. Starting at ₹1,999.',
    icon: <HomeWork sx={{ fontSize: 40 }} />,
    image: 'https://images.unsplash.com/photo-1506318137071-a8e063b4bec0?auto=format&fit=crop&w=1024&q=80',
    path: '/home',
    color: 'primary.light',
    products: [
      {
        id: 11,
        name: 'Galaxy Projector Pro',
        price: 2499,
        description: 'High-quality galaxy projector with remote control',
        image: 'projector1.jpg'
      },
      {
        id: 12,
        name: 'Constellation Bedding Set',
        price: 1999,
        description: 'Premium bedding set with constellation design',
        image: 'bedding1.jpg'
      }
    ]
  },
];

const Home = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (category) => {
    navigate(`/category${category.path}`, { state: { products: category.products } });
  };

  return (
    <Box sx={{ py: 6, minHeight: '100vh' }}>
      <Container>
        <Typography
          variant="h3"
          component="h1"
          align="center"
          gutterBottom
          sx={{
            fontWeight: 700,
            background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            mb: 6,
          }}
        >
          Explore Our Cosmic Collection
        </Typography>

        <Grid container spacing={4}>
          {categories.map((category) => (
            <Grid item xs={12} sm={6} md={4} key={category.id}>
              <Card
                onClick={() => handleCategoryClick(category)}
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  cursor: 'pointer',
                  transition: '0.3s',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                    boxShadow: '0 12px 20px rgba(0,0,0,0.2)',
                  },
                  bgcolor: 'background.paper',
                  borderRadius: 2,
                  overflow: 'hidden',
                }}
              >
                <CardMedia
                  component="img"
                  height="200"
                  image={category.image}
                  alt={category.name}
                  sx={{
                    objectFit: 'cover',
                  }}
                />
                <CardContent sx={{ flexGrow: 1, p: 3 }}>
                  <Box
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      mb: 2,
                      color: category.color,
                    }}
                  >
                    <IconButton
                      sx={{
                        mr: 1,
                        color: 'inherit',
                        bgcolor: 'rgba(255,255,255,0.1)',
                      }}
                    >
                      {category.icon}
                    </IconButton>
                    <Typography variant="h6" component="h2">
                      {category.name}
                    </Typography>
                  </Box>
                  <Typography
                    variant="body2"
                    color="text.secondary"
                    sx={{ minHeight: 60 }}
                  >
                    {category.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
